(31, 11, 'id', 'dr Rizki Citra Mulia, Sp.Dv adalah dokter kulit dan kelamin yang berpraktik di Klinik Derven Dermatology, Kota Bekasi, Jawa Barat. Dia selalu melayani para pasiennya dengan baik.\n\nPerempuan tersebut meraih gelar kedokterannya setelah lulus dari Universitas Hasanuddin (Unhas) pada tahun 2020, Program Studi Spesialis Kulit dan Kelamin.', '2021-04-19 21:22:54', '2021-04-20 04:22:54'),
(32, 11, 'en', '', '2021-04-19 21:22:54', '2021-04-20 04:22:54'),
(33, 12, 'id', 'dr Tasa Tammya adalah dokter kecantikan yang berpraktik di J-Glow Aesthetic Clinic, Kota Bandung, Jawa Barat. Dalam memberikan pelayanan kepada setiap pasiennya, dr Tasa selalu melayaninya dengan baik.\n\nPerempuan tersebut meraih gelar kedokterannya setelah lulus dari Universitas Islam Bandung (Unisba) pada tahun 2013,', '2021-04-19 21:23:04', '2021-04-20 04:23:04'),
(34, 12, 'en', '', '2021-04-19 21:23:04', '2021-04-20 04:23:04'),
(39, 13, 'id', 'dr Farina, M. Biomed (AAM) adalah Konsultan Anti-Aging & Aesthetic dari Farina Beauty Clinic. Dia juga merupakan pemilik 13 cabang Farina Beauty Clinic yang tersebar di Jakarta, Cikarang, Karawang, Bekasi, Purwakarta, Subang, dan Majalengka.\n\ndr Farina selalu menerapkan kepada seluruh karyawannya untuk selalu memberikan pelayanan yang terbaik bagi setiap pelanggannya.', '2021-04-25 23:09:59', '2021-04-26 06:09:59'),
(40, 13, 'en', '', '2021-04-25 23:09:59', '2021-04-26 06:09:59'),
(41, 15, 'id', 'dr Handy adalah dokter kecantikan yang berpraktik di MD Clinic, Buah Batu, Kota Bandung, Jawa Barat. Pria ini selalu memberikan pelayanan yang terbaik kepada setiap pasiennya.\n\nDokter Handy berharap bagi wanita Indonesia yang ingin tampil cantik dengan kulit yang diidamkan harus melakukan perawatan melalui dokter yang ahli di bidangnya.', '2021-05-04 01:31:03', '2021-05-04 08:31:03'),
(42, 15, 'en', '', '2021-05-04 01:31:03', '2021-05-04 08:31:03'),
(43, 14, 'id', 'dr Gesha Kautzar Putri, M. Biomed (AAM) merupakan dokter estetika di Elite Clinic yang berada di Jakarta Selatan, DKI Jakarta. Perempuan ini meraih gelar S2 Kedokteran Anti Penuaan (Anti-Aging Medicine) di Universitas Udayana, Bali (2016-2018).\n\nDengan keahlian dan pengalaman yang dimilikinya, dr Gesha selalu memberikan pelayanan terbaik agar setiap pasiennya terpuaskan saat berkonsultasi ataupun melakukan treatment di tempatnya membuka praktik.', '2021-05-10 01:56:23', '2021-05-10 08:56:23'),
(44, 14, 'en', '', '2021-05-10 01:56:23', '2021-05-10 08:56:23'),
(47, 17, 'id', 'dr Eklendro Senduk (dr Ekles), D.AAAM, M.Ks adalah dokter yang berpraktik di Ekles Clinic. Selain kesibukannya menjadi dokter, pria kelahiran Manado, 7 Juni 1984 ini, juga hobi menyanyi.\n\nSetelah lulus Kedokteran Umum di Universitas Sam Ratulangi (Unsrat), dia melanjutkan studi di American Academy of Aesthetic Medicine. Lalu dia kembali mengikuti master class injeksi botoks dan filler di Universitas chulalongkorn Thailand dan European Academy of Dermatology and Venereology.', '2021-05-30 10:27:24', '2021-05-30 17:27:24'),
(48, 17, 'en', '', '2021-05-30 10:27:24', '2021-05-30 17:27:24'),
(51, 16, 'id', 'dr Agusmawi adalah dokter yang berpraktik di Klinik Pandawa, Jakarta Pusat, DKI Jakarta. Di klinik spesialis kulit dan kelamin tersebut, dr Agusmawi selalu berusaha memberikan pelayanan terbaik kepada setiap pasiennya.\n\nDia meraih gelar kedokterannya setelah lulus dari Universitas Sriwijaya (Unsri) pada tahun 2001.', '2021-06-16 01:30:25', '2021-06-16 08:30:25'),
(52, 16, 'en', '', '2021-06-16 01:30:25', '2021-06-16 08:30:25'),
(57, 18, 'id', 'dr. Christian J.E. Chandra, Dipl. AAAM merupakan founder dari Jevon Aesthetic Clinic. Pria kelahiran 2 Maret 1989, memiliki segudang predikat.\n\nDia meraih gelar kedokterannya setelah lulus dari Universitas Sam Ratulangi (UNSRAT) pada tahun 2014. Dalam memberikan pelayanan kepada setiap pasiennya, dr Chris selalu melayani dengan maksimal.', '2021-06-16 20:34:32', '2021-06-17 03:34:32'),
(58, 18, 'en', '', '2021-06-16 20:34:32', '2021-06-17 03:34:32'),
(59, 19, 'id', 'dr. Luman, M.Gizi  adalah dokter praktik mandiri perorangan di daerah Paramount, Serpong, Tangerang, Banten. Dalam praktiknya, dr. Luman selalu memberikan pelayanan terbaik kepada setiap pasiennya.\n\nDia meraih gelar S2 kedokterannya setelah lulus dari Universitas Indonesia (UI) pada tahun 2013.', '2021-07-22 21:42:29', '2021-07-23 04:42:29'),
(60, 19, 'en', '', '2021-07-22 21:42:29', '2021-07-23 04:42:29'),
(61, 20, 'id', 'Damel Syafitri adalah instruktur senam aerobik, yoga, zumba, dan lainnya. Dia aktif dalam memandu gerakan-gerakan senam kepada para peserta yang ingin selalu memiliki tubuh yang sehat.\n\nMba Imel, sapaan akrabnya, juga bisa memandu gerakan senam bagi orang yang punya program khusus, seperti menurunkan berat badan dan lainnya.', '2021-09-13 00:11:20', '2021-09-13 07:11:20'),
(62, 20, 'en', '', '2021-09-13 00:11:20', '2021-09-13 07:11:20'),
(67, 21, 'id', 'dr. Dina Udayani Swadeshi, Sp.KK telah menamatkan pendidikan Kedokteran Spesialis Kulit dan Kelamin di Universitas Padjadjaran pada 2009.\n\nSebelumnya dia menempuh pendidikan Kedokteran Umum di Universitas Trisakti pada 2002. Dia terhimpun dalam Perhimpunan Dokter Spesialis Kulit dan Kelamin Indonesia.', '2021-09-20 02:26:08', '2021-09-20 09:26:08'),
(68, 21, 'en', '', '2021-09-20 02:26:08', '2021-09-20 09:26:08'),
(69, 22, 'id', 'Ketua Komunitas Sepeda Jakarta Timur (SEJATI), Zikky Hermansyah dan para anggotanya rutin melakukan aktivitas sepeda untuk menjaga tubuh tetap sehat.\n\nSelain untuk kesehatan, Zikky dan sesama anggota pesepeda yang lain bisa mempererat hubungan melalui bersepeda.', '2021-09-28 20:49:23', '2021-09-29 03:49:23'),
(70, 22, 'en', '', '2021-09-28 20:49:23', '2021-09-29 03:49:23'),
(71, 23, 'id', 'Anggun Fajarwati adalah instruktur renang profesional berpengalaman yang selalu memberikan pelayanan atau pembelajaran kepada setiap para pesertanya.\n\nDalam memberikan arahan di sesi pelatihan, Anggun selalu berupaya memberikan pembelajaran teknik berenang yang baik dan benar.', '2021-10-14 00:51:12', '2021-10-14 07:51:12'),
(72, 23, 'en', '', '2021-10-14 00:51:12', '2021-10-14 07:51:12'),
(77, 24, 'id', 'Dokter  Rizki Rahmania Ramdhani, M. Biomed (AAM) adalah dokter kecantikan yang berpraktik sekaligus owner di Sebu Clinic, Surabaya, Jawa Timur.\n\nPerempuan lulusan dari Universitas Udayana pada 2020 (S2 Anti-Aging Medicine) ini, selalu memberikan pelayanan terbaik kepada setiap pasiennya.', '2021-11-02 23:31:14', '2021-11-03 06:31:14'),
(78, 24, 'en', '', '2021-11-02 23:31:14', '2021-11-03 06:31:14'),
(81, 25, 'id', 'dr. Inna Milkie Amnun Istauva merupakan dokter yang berpraktik di Shofi Aesthetic Clinic di Malang, Jawa Timur. Anak dari pasangan Mujamil Komar dan Yuli Isminingtyas, ini selalu memberikan pelayanan terbaik kepada setiap pasien.\n\nSelain praktik di Shofi Aesthetic Clinic, dr. Inna Milkie Amnun Istauva juga praktik di salah satu rumah sakit di Malang.', '2021-11-09 03:10:58', '2021-11-09 10:10:58'),
(82, 25, 'en', '', '2021-11-09 03:10:58', '2021-11-09 10:10:58'),
(83, 26, 'id', 'Dokter Spesialis Kulit dan Kelamin yang berpraktik di Surabaya Skin Centre ini telah menyelesaikan pendidikan Kedokteran Umum di Universitas Udayana pada 1992.\n\nPerempuan bernama dr. Ary Widhyasti Bandem, M.Kes, Sp.KK, FINSDV, FAADV ini, melanjutkan pendidikan Magister Kesehatan di Universitas Gadjah Mada (UGM) pada 2003 dan lulus pada 2004. Lalu pada 2007, dr. Ary menyelesaikan pendidikan Spesialis Kulit dan Kelamin di Universitas Gadjah Mada.', '2021-11-15 21:47:34', '2021-11-16 04:47:34'),
(84, 26, 'en', '', '2021-11-15 21:47:34', '2021-11-16 04:47:34'),
(87, 27, 'id', 'dr. Stefani Nurhadi, M.Biomed, Sp.KK adalah Dokter Kulit dan Kelamin yang berpraktik di Acne Institute Clinic (AIC). Dia bisa melayani pasien yang ingin berkonsultasi kesehatan kulit dan kelamin.\n\nDokter Stefani telah menyelesaikan pendidikan Dokter Spesialis Dermatologi dan Venereologi di Universitas Udayana. Tak hanya itu, dia juga tercatat sebagai anggota Ikatan Dokter Indonesia (IDI) dan Perhimpunan Dokter Spesialis Kulit dan Kelamin Indonesia (PERDOSKI).', '2021-11-18 20:48:34', '2021-11-19 03:48:34'),
(88, 27, 'en', '', '2021-11-18 20:48:34', '2021-11-19 03:48:34'),
(89, 28, 'id', 'dr. Novaria Sonata merupakan pemilik dari dr. VA Aesthetic Clinic & Laser, di Serang, Banten. Selain itu, wanita ini juga berpraktik di kliniknya untuk melayani para pelanggannya.\n\nDokter Novaria Sonata selalu berupaya memberikan pelayanan terbaik kepada pasien. Dengan demikian para pasien bisa merasa puas dan mendapatkan hasil yang maksimal.', '2021-11-22 03:20:47', '2021-11-22 10:20:47'),
(90, 28, 'en', '', '2021-11-22 03:20:47', '2021-11-22 10:20:47'),
(91, 29, 'id', 'dr. Farhani Alhabsy adalah dokter yang berpraktik di dr. Farhani Aesthetic Clinic di Banjarmasin, Kalimantan Selatan. Dia selalu memberikan pelanan terbaik kepada setiap pasiennya.', '2021-11-25 01:37:23', '2021-11-25 08:37:23'),
(92, 29, 'en', '', '2021-11-25 01:37:23', '2021-11-25 08:37:23'),
(93, 30, 'id', 'dr. Leni Kumalasari Dipl.AAAM adalah dokter yang sudah berpengalaman lebih dari 15 tahun dalam bidang aesthetic sekaligus CEO Skinda Dermato Aesthetic Clinic di Surabaya.\n\nDokter yang gemar bersepeda ini, selalu memberikan pelayanan terbaik kepada setiap pasien yang datang ke Skinda Dermato Aesthetic Clinic.', '2021-11-26 00:47:43', '2021-11-26 07:47:43'),
(94, 30, 'en', '', '2021-11-26 00:47:43', '2021-11-26 07:47:43'),
(95, 31, 'id', 'dr. Devina Ekalia, dipl. AAAM adalah owner sekaligus dokter yang berpraktik di Dr. DE Aesthetic Clinic. Dokter Devina Ekalia selalu memberikan pelayanan maksimal kepada setiap pasiennya.\n\nBerbagai macam perawatan yang ditawarkan di antaranya facial, peeling, laser, acne treatment, hair removal, slimming, whitening, memudarkan pembuluh darah di wajah hingga DNA salmon..', '2021-12-06 03:18:12', '2021-12-06 10:18:12'),
(96, 31, 'en', '', '2021-12-06 03:18:12', '2021-12-06 10:18:12'),
(97, 32, 'id', 'dr. Ayu Widyaningrum, MM, Master of AAAM adalah dokter sekaligus owner dari Widya Esthetic Clinic di Banjarmasin, Kalimantan Selatan.\n\nDokter kelahiran Kotabaru, 12 Agustus 1990 ini sering menerima berbagai penghargaan dalam bidang estetika di pada 2018 dan 2019. Wanita lulusan S1 di Unlam Banjarmasin, ini melanjutkan pendidikan Magister Manajemen Banjarmasin, Master of AAAM di Hongkong dan Eropa, serta Master of IBAMS dari Bangkok, Thailand.', '2021-12-07 03:06:19', '2021-12-07 10:06:19'),
(98, 32, 'en', '', '2021-12-07 03:06:19', '2021-12-07 10:06:19'),
(99, 33, 'id', 'dr. Devy, Dipl. AAAM adalah owner dari Devanka Aesthetic Clinic yang didirikan pada 2017. Sejak dibuka, dokter yang juga berpraktik di klinik tersebut mendapat respons positif dari para pasien.\n\nBerawal dari klinik rumahan, kini klinik yang dijalankannya melayani berbagai pelayanan perawatan kecantikan, seperti botox, filler, dan tanam benang.', '2021-12-13 00:09:03', '2021-12-13 07:09:03'),
(100, 33, 'en', '', '2021-12-13 00:09:03', '2021-12-13 07:09:03'),
(101, 34, 'id', 'dr. Loudfy Eka Widyawati, M. Biomed (AAM) adalah dokter estetika yang berpraktik di Rumah Ratu Beauty Clinic di Banjarmasin, Kalimantan Selatan.\n\nDalam melayani setiap pasien, dokter Loudfy selalu memberikan pelayanan yang terbaik. Berbagai macam perawatan kecantikan diberikan demi melayani kebutuhan pasien.', '2021-12-20 01:09:13', '2021-12-20 08:09:13'),
(102, 34, 'en', '', '2021-12-20 01:09:13', '2021-12-20 08:09:13'),
(103, 35, 'id', 'dr. Dina Aulia Insani Sp.GK adalah dokter Spesialis Gizi Klinik yang berpraktik di Klinik Kinibalu Skin & Slimming Center, Banjarmasin, kalimantan Selatan.\n\nDokter Dina Aulia Insani memberikan pelayanan kepada setiap pasien yang membutuhkannya dengan maksimal.', '2021-12-22 22:08:31', '2021-12-23 05:08:31'),
(104, 35, 'en', '', '2021-12-22 22:08:31', '2021-12-23 05:08:31'),
(105, 36, 'id', 'dr. Erika Dewi Essary, Sp.DV adalah seorang Dokter Spesialis Penyakit Kulit dan Kelamin yang berpraktik di Klinik Kinibalu Skin & Slimming Center, Banjarmasin, Kalimantan Selatan.\n\nDokter Erika Dewi Essary selalu memberikan pelayanan terbaik kepada setiap pasiennya. Dia juga melayani konsultasi bagi pasien yang membutuhkannya.', '2021-12-22 22:47:08', '2021-12-23 05:47:08'),
(106, 36, 'en', '', '2021-12-22 22:47:08', '2021-12-23 05:47:08'),
(107, 37, 'id', 'Dr. Nanang Miftah Fajari, Sp.PD-KEMD adalah Dokter Spesialis Penyakit Dalam, Konsultan Endoktrin Metabolik dan Diabetes, dari Rumah Sakit Umum Nirwana, Banjarbaru, Kalimantan Selatan.\n\nDokter luluan S2, Fakultas Kedokteran Universitas Brawijaya, Malang, selalu melayani setiap pasiennya dalam mengobati penyakit dalam.', '2021-12-24 01:02:00', '2021-12-24 08:02:00'),
(108, 37, 'en', '', '2021-12-24 01:02:00', '2021-12-24 08:02:00'),
(109, 38, 'id', 'Rahmat adalah pengelola Waytuki vegetarian food sejak 2011 lalu. Bagi para pecinta makanan vegetarian food bisa mampir ke gerai Waytuki yang berlokasi di Pasar Baru, Sawah Besar, Jakarta Pusat.\n\nPria setengah baya itu juga melayani layanan pesan antar atau delivery order dan tanpa batas minimum. Makanan khas India ini juga melayani pembelian di berbagai marketplace.', '2021-12-28 02:43:47', '2021-12-28 09:43:47'),
(110, 38, 'en', '', '2021-12-28 02:43:47', '2021-12-28 09:43:47'),
(111, 39, 'id', 'dr. Hasrul Nazar, Dipl. AAAM, Akp merupakan dokter Umum. Dia telah menyelesaikan studi kedokteran di Universitas Lambung Mangkurat (ULM) di Banjarmasin, Kalimanta Selatan.\n\nDokter Hasrul Nazar adalah owner sekaligus praktik di dr. Naz Aesthetic Clinic di Banjarmasin, Kalimantan Selatan.', '2021-12-30 21:00:39', '2021-12-31 04:00:39'),
(112, 39, 'en', '', '2021-12-30 21:00:39', '2021-12-31 04:00:39'),
(115, 41, 'id', 'dr. Liliana Santoso merupakan dokter kecantikan yang berpraktik di Liliana Beauty Care, Banjarmasin, Kalimantan Selatan.\r\n\r\nDokter Liliana memberikan layanan perawatan kulit, salah satunya adalah perawatan kulit kering dan kasar. Selain itu, berbagai treatment kecantikan lainnya juga ditawarkan di Liliana Beauty Care.', '2022-01-28 01:13:16', '2022-01-28 08:13:16'),
(116, 41, 'en', '', '2022-01-28 01:13:16', '2022-01-28 08:13:16'),
(117, 40, 'id', 'Rachelyn Tanu, RD adalah Direktur Bluezone Center, gerai yang menyajikan beraneka hidangan vegetarian. Harga yang ditawarkan dari gerbagai hidangan sehat tersebut berkisar Rp 50-100.000.\r\n\r\nTempat makan yang dikelolanya itu juga melayani konsultasi seputar nutrisi. Nantinya akan disesuaikan dengan hidangan yang akan disuguhkan.', '2022-02-02 21:31:59', '2022-02-03 04:31:59'),
(118, 40, 'en', '', '2022-02-02 21:31:59', '2022-02-03 04:31:59'),
(119, 42, 'id', 'dr. Johana Fitriani, M. Farm adalah pemilik Klinik Pratama dr Jo di wilayah Kota Bekasi dan Cikarang Utara. Dia mendirikan klinik kecantikan tersebut pada 2013 lalu.\r\n\r\nPerempuan yang memiliki visi menciptakan masyarakat Indonesia yang cantik dan sehat ini, juga berpraktik di kliniknya untuk memberikan pelayanan kepada masyarakat.', '2022-02-02 22:13:09', '2022-02-03 05:13:09'),
(120, 42, 'en', '', '2022-02-02 22:13:09', '2022-02-03 05:13:09'),
(121, 43, 'id', 'dr. Dina OKtaviani, M. Biomed (AAM), adalah dokter kecantikan yang berpraktik di Klinik Dermaglam Skin & Body Care Taman Alfa Indah (Joglo, Kembangan, Jakarta Barat), Dermaglam Maternity & Women’s Aesthetic Clinic Pantai Indah Kapuk (Penjaringan, Jakarta Utara), Dermaglam Skin & Body Care Bengkulu (Lingkar Timur, Bengkulu), dan Praktik Pribadi dr. Dina (Ciangsana, Bogor).\r\n\r\nDokter kelahiran 27 Oktober 1988 ini, dari hasil pernikahannya dengan dr. Syah Prian dianugerahi dua anak yang mereka sayangi.', '2022-02-03 00:09:36', '2022-02-03 07:09:36'),
(122, 43, 'en', '', '2022-02-03 00:09:36', '2022-02-03 07:09:36'),
(125, 44, 'id', 'dr. Vina Dwiana Savitri, Sp.KK, FINSDV, FAADV adalah dokter yang berpraktik di The Corneum Institute, Banjarmasin, Kalimantan Selatan. Alumnus SMPN 72 Jakarta dan SMAN 68 Jakarta ini, melayani permasalahan kulit yang dihadapi masyarakat.\r\n\r\nPerempuan lulusan Fakultas Kedokteran Umum di Universitas Trisakti Jakarta selalu memberikan pelayanan terbaik kepada setiap pasien.', '2022-02-03 01:12:47', '2022-02-03 08:12:47'),
(126, 44, 'en', '', '2022-02-03 01:12:47', '2022-02-03 08:12:47'),
(129, 45, 'id', 'Salah satu restoran vegetarian food di bilangan Jakarta Utara yakni Vegetus Vegetarian. Di rumah makan ini, menyajikan Chinese food dan Indonesian food, termasuk makanan halal yang bisa dikonsumsi berbagai kalangan.\r\n\r\nHidangan andalan di tempat ini adalah babi panggang. Karena vegetarian, makanan favorit ini bukan dari daging babi, melainkan terbuat dari tepung talas dan kedelai.', '2022-02-03 02:10:09', '2022-02-03 09:10:09'),
(130, 45, 'en', '', '2022-02-03 02:10:09', '2022-02-03 09:10:09'),
(131, 46, 'id', 'dr. Venny Wijaya, M. Biomed (AAM) adalah Head Doctor di Dea Mirabelle Skin Care & Beauty Center. Dokter Venny selalu memberikan pelayanan terbaik kepada setiap pasiennya.\r\n\r\nSalah satu perawatan yang menjadi keunggulan di kliniknya adalah hybrid treatment. Perawatan ini mempunyai dua keunggulan, yaitu skin quality dan face contouring.', '2022-02-14 22:13:28', '2022-02-15 05:13:28'),
(132, 46, 'en', '', '2022-02-14 22:13:28', '2022-02-15 05:13:28'),
(133, 47, 'id', 'dr. Gemala Jasa Harsyani adalah owner dan dokter kecantikan di Klinik Jeha Medika, Kabupaten Bekasi. Kliniknya melayani berbagai perawatan kecantikan.\r\n\r\nDokter Gemala selalu memberikan pelayanan yang terbaik kepada setiap pelanggannya.', '2022-02-22 21:36:08', '2022-02-23 04:36:08'),
(134, 47, 'en', '', '2022-02-22 21:36:08', '2022-02-23 04:36:08'),
(135, 48, 'id', 'dr. Dedy Chandra adalah Founder DL Slim & Skin Care yang didirikannya bersama dr. Lia Yulia pada 2002 lalu. Demi melayani kebutuhan masyarakat terhadap perawatan kecantikan, kliniknya menyediakan berbagai treatment.\r\n\r\nSalah satu treatment unggulan di DL Slim & SKin Care adalah PRP DNA salmon. Dengan perawatan PRP DNA salmon, kulit tidak hanya putih dan bersih, tapi juga mengkilat.', '2022-03-01 01:26:48', '2022-03-01 08:26:48'),
(136, 48, 'en', '', '2022-03-01 01:26:48', '2022-03-01 08:26:48'),
(137, 49, 'id', 'dr. Gemala Jasa Harsyani adalah dokter kecantikan yang praktik di Klinik Jeha Medika yang berlokasi di Kabupaten Bekasi, Jawa Barat. Klinik tempatnya berpraktik menawarkan berbagai treatment perawatan kecantikan.\r\n\r\nSelain memberikan layanan berbagai jenis treatment, Klinik Jeha Medika juga menawarkan produk kecantikan yang tak kalah dengan produk lainnya.', '2022-03-24 02:38:09', '2022-03-24 09:38:09'),
(138, 49, 'en', '', '2022-03-24 02:38:09', '2022-03-24 09:38:09'),
(139, 50, 'id', 'dr. Maya Safriana Lubis, AIFO-K dan dr. Mariza Alwi Harahap merupakan owner dari AA Clinic yang pada 2022 ini sudah memiliki tiga cabang. Keduanya juga berpraktik sebagai dokter kecantikan di klinik yang didirikannya.\r\n\r\nBerbagai layanan perawatan kecantikan ditawarkan di klinik miliknya. Salah satu perawatannya adalah suntik filler yang memang tengah diminati.', '2022-04-03 23:54:46', '2022-04-04 06:54:46'),
(140, 50, 'en', '', '2022-04-03 23:54:46', '2022-04-04 06:54:46'),
(141, 51, 'id', 'dr. Imelda, AAAM (USA), M. Biomed (AAM), M.H, MKM merupakan owner dari Kliniix Slim, di Medan, Sumatera Utara. Dia juga berpraktik di klinik yang didirikannya pada 2005 lalu.\r\n\r\nBerbagai layanan perawatan kecantikan di Kliniix Slim milik dr. Imelda Tjoe, seperti pengobatan jerawat, body slimming, dan sebagainya.', '2022-04-11 01:08:25', '2022-04-11 08:08:25'),
(142, 51, 'en', '', '2022-04-11 01:08:25', '2022-04-11 08:08:25'),
(143, 52, 'id', 'Anthony Adam merupakan Head Coach dan Owner Green Skate Lesson. Wadah bagi skater cilik ini didirikan pada 2009, yang bertujuan untuk mengajarkan teknik-teknik dasar skateboard.\r\n\r\nPelatihan yang ditawarkan ada dua, yaitu hobi dan prestasi. Jika hobi, jadwal latihannya lebih fleksibel. Sedangkan untuk jalur prestasi, diperuntukan untuk anak-anak mulai dari usia sekolah dasar hingga sekolah menengah pertama.', '2022-04-11 02:01:39', '2022-04-11 09:01:39'),
(144, 52, 'en', '', '2022-04-11 02:01:39', '2022-04-11 09:01:39'),
(145, 53, 'id', 'Presiden Parkour Jakarta, Ramdani Murtadho mengatakan olahraga parkour memiliki berbagai kesehatan bagi tubuh. Jika ada yang berminat berlatih parkour, bisa bergabung dengan komunitas Parkour Jakarta dengan mengunjungi @parkourjkt\r\n\r\nAda berbagai macam teknik yang harus dikuasai, mulai dari lompatan atas bawah, roll, wall climb, jumping over, precision jump, vaulting Swinging through, cat leap, wall spin dan lainnya.', '2022-04-19 01:02:57', '2022-04-19 08:02:57'),
(146, 53, 'en', '', '2022-04-19 01:02:57', '2022-04-19 08:02:57'),
(147, 54, 'id', 'dr. Sweeta Isabel B. Situmeang adalah dokter kecantikan di Michelle Beauty Skin Care, Medan, Sumatera Utara. Klinik miliknya itu melayani berbagai perawatan kecantikan, seperti filler, botox, tanam benang, dan sebagainya.\r\n\r\nDokter Sweeta selalu berusaha memberikan pelayanan terbaik kepada setiap pelanggannya.', '2022-04-20 01:06:46', '2022-04-20 08:06:46'),
(148, 54, 'en', '', '2022-04-20 01:06:46', '2022-04-20 08:06:46'),
(149, 55, 'id', 'Belinda Rena Bachtiar merupakan trainer pound fit dari Sukapound. Dia bersama rekan sesama trainer yaitu Mytha Dewinta Pramuningtyas setia memandu para peserta dalam olahraga pound fit.\r\n\r\nPound fit merupakan kardio yang terinspirasi permainan alat musik drum dengan menggunakan stik drum ringan bernama ripstix.', '2022-04-25 23:01:18', '2022-04-26 06:01:18'),
(150, 55, 'en', '', '2022-04-25 23:01:18', '2022-04-26 06:01:18'),
(151, 56, 'id', 'dr. Maya Safriana Lubis, AIFO-K merupakan owner dari AA Clinic di Medan, Sumatera Utara. Dia dan suaminya, dr. Mariza Alwi Harahap mengelola klinik AA dan keduanya juga berpraktik sebagai dokter kecantikan.\r\n\r\nDokter Maya, selalu memberikan pelayanan terbaik kepada setiap pasien yang datang. Klinik AA melayani berbagai perawatan kecantikan.', '2022-04-27 00:58:38', '2022-04-27 07:58:38'),
(152, 56, 'en', '', '2022-04-27 00:58:38', '2022-04-27 07:58:38'),
(153, 57, 'id', 'dr. Muna Soraya Putri, M.Biomed (AAM) adalah dokter kecantikan yang berpraktik di Klinik NYM Aesthetic di Medan, Sumatera Utara.\r\n\r\nDalam melayani setiap pasien, dr. Muna Soraya selalu memberikan yang terbaik. Salah satu layanan yang diberikan di Klinik NYM Aesthetic adalah perawatan skin booster.', '2022-05-23 03:27:48', '2022-05-23 10:27:48'),
(154, 57, 'en', '', '2022-05-23 03:27:48', '2022-05-23 10:27:48');
