(143, 72, 'id', 'Tips Sederhana Dapatkan Kulit Cantik dan Sehat', 'kulit cantik, kulit cantik dan sehat, kulit sehat, makanan untuk kulit sehat', 'Memiliki kulit yang ideal cukup dengan menerapkan pola hidup yang sehat dan melakukan perawatan kulit. Berikut tips mendapatkan kulit cantik dan sehat.'),
(144, 72, 'en', '', '', ''),
(145, 73, 'id', 'Gampang Sakit, Ini Cara Meningkatkan Imunitas Tubuh', 'cara meningkatkan imunitas tubuh, imunitas tubuh, sistem imunitas tubuh, makanan untuk imunitas tubuh', 'Sistem imunitas penting agar tidak mudah sakit. Ada banyak cara meningkatkan imunitas tubuh dengan mudah, misalnya melakukan gaya hidup dan makan yang sehat.'),
(146, 73, 'en', '', '', ''),
(147, 74, 'id', 'video 1', 'video 1', 'Secan.id, Jakarta - Berbicara sariawan sama halnya membicarakan penyakit “sejuta umat”. Alasannya, mungkin hampir tiap orang pernah mengalami penyakit ini, setidaknya sekali dalam seumur hidupnya.\n\n\n\nStomatitis aftosa, begitu sariawan disebut dalam dunia kedokteran, merupakan luka di dalam mulut yang dapat menimbulkan rasa sakit dan tidak nyaman. Luka yang timbul ini bisa berbentuk oval atau bulat dan berwarna putih atau kuning. Luka ini memiliki tepian berwarna merah akibat peradangan. Bagaimana dengan lokasinya?\n\n\n\nLokasi sariawan ini bisa terjadi dibagian dalam pipi, bibir, ataupun permukaan gusi dan lidah dengan jumlahnya bisa satu, maupun lebih. Hal yang perlu diingat, sariawan ini bisa dialami siapa saja, termasuk anak-anak, bahkan bayi.\n\n\n\nNah, pertanyaannya, bagaimana sih cara mengobati sariawan pada anak-anak?\n\nBaca juga: Cari Tahu 5 Penyebab Sariawan dan Cara Mengatasinya'),
(148, 74, 'en', '', '', ''),
(165, 83, 'id', 'Tips Sederhana Dapatkan Kulit Cantik dan Sehat', 'kulit cantik, kulit cantik dan sehat, kulit sehat, makanan untuk kulit sehat', 'Untuk memiliki kulit cantik tidak harus mahal. Cukup dengan menerapkan pola hidup sehat dan melakukan perawatan kulit secara rutin, agar kulit cantik dan sehat.'),
(166, 83, 'en', '', '', ''),
