(225, 115, 'id', 'Artikel Kecantikan', 'Artikel Kecantikan', 'Artikel Kecantikan'),
(226, 115, 'en', '', '', ''),
(355, 180, 'id', 'Jika Indra Penciuman Hilang, Begini Cara Mengatasinya', 'indra penciuman hilang, hilang indra penciuman, kehilangan indra penciuman, penyebab indra penciuman hilang', 'Ada beberapa faktor penyebab indra penciuman hilang. Hilangnya indra penciuman bisa sementara dan jangka waktu panjang. Kenali penyebab dan mengatasinya.'),
(356, 180, 'en', '', '', ''),
(357, 181, 'id', 'Mau Punya Kulit Cantik dan Sehat? Ini Tipsnya', 'kulit, kulit cantik, kulit cantik dan sehat, kulit sehat, makanan untuk kulit sehat', 'Untuk memiliki kulit cantik tidak harus mahal. Cukup dengan menerapkan pola hidup sehat dan melakukan perawatan kulit secara rutin, agar kulit cantik dan sehat.'),
(358, 181, 'en', '', '', ''),
(361, 183, 'id', 'Gampang Sakit? Ikuti Cara Meningkatkan Imunitas Tubuh', 'cara meningkatkan imunitas tubuh, imunitas tubuh, sistem imunitas tubuh, makanan untuk imunitas tubuh', 'Meningkatkan imunitas tubuh penting, agar tubuh tidak cepat sakit. Beragam cara bisa dilakukan meningkatkan sistem imunitas, salah satunya gaya hidup sehat.'),
(362, 183, 'en', '', '', ''),
(363, 184, 'id', 'Membongkar Rahasia Kulit Putih Korea yang Perlu Diketahui', 'kulit putih, rahasia kulit putih korea, rahasia kulit putih, kulit putih glowing', 'Memiliki kulit putih glowing ala Korea adalah impian setiap wanita yang ingin selalu terlihat cantik. Ini rahasia kulit putih Korea yang perlu diketahui.'),
(364, 184, 'en', '', '', ''),
(365, 185, 'id', 'Manfaat Konsultasi Dokter Kesehatan yang Wajib Diketahui', 'konsultasi dokter, konsul dokter, dokter kesehatan', 'Jika kondisi tidak fit atau kurang sehat maka akan mudah terserang penyakit. Untuk itu penting untuk melakukan konsultasi dokter yang ahli di bidangnya.'),
(366, 185, 'en', '', '', ''),
(367, 186, 'id', 'Jerawat Susah Hilang! Ini Cara Menghilangkan Jerawat Bandel', 'jerawat, cara menghilangkan jerawat membandel, cara menghilangkan jerawat bandel, jerawat bandel', 'Masalah kulit yang sering dialami wanita maupun pria dan membuat tidak nyaman adalah jerawat. Bagaimana cara menghilangkan jerawat membandel, simak ulasannya.'),
(368, 186, 'en', '', '', ''),
(369, 187, 'id', 'Susah Turunkan Berat Badan? Ini Cara Gampangnya', 'berat badan, berat badan ideal, menurunkan berat badan, menurunkan berat badan dengan cepat', 'Sudah berusaha berbagai cara tapi berat badan belum turun, bisa jadi langkah yang dilakukan belum tepat. Simak tentang cara menurunkan berat dengan cepat.'),
(370, 187, 'en', '', '', ''),
(371, 188, 'id', 'Mengintip Rahasia Memilih Produk Skincare Terbaik', 'skincare, skincare terbaik, skincare untuk kulit berminyak, skincare untuk kulit sensitif, skincare  yang bagus, skincare  kulit kering', 'Salah satu cara untuk mewujudkan tampil memesona adalah dengan melakukan perawatan kulit menggunakan skincare. Ini rahasia memilih produk skincare terbaik.'),
(372, 188, 'en', '', '', ''),
(373, 189, 'id', 'Cara Membentuk Tubuh Kurus Menjadi Ideal', 'berat badan ideal, kurus, penyebab tubuh kurus, tubuh kurus menjadi ideal, membentuk tubuh kurus menjadi ideal', 'Memiliki tubuh kurus bukanlah petaka, karena tetap bisa membentuk tubuh menjadi terlihat ideal. Yang terpenting mengetahui cara membentuk tubuh secara alami.'),
(374, 189, 'en', '', '', ''),
(375, 190, 'id', 'Menyebalkan! Ini Cara Menghilangkan Komedo Secara Alami', 'komedo, cara menghilangkan komedo di hidung, komedo hitam, komedo di hidung, komedo di wajah', 'Komedo timbul karena pori-pori tersumbat sel kulit mati dan minyak berlebih, sehingga membuat tidak nyaman. Ini cara menghilangkan komedo secara alami.'),
(376, 190, 'en', '', '', ''),
(377, 191, 'id', 'Badan Cepat Lelah? Begini Cara Mengatasinya', 'cepat lelah, penyebab cepat lelah, cepat capek, kenapa badan cepat lelah, penyebab badan cepat lelah, cara mengatasi cepat lelah', 'Badan cepat lelah bisa disebabkan sejumlah hal. Apabila tubuh capek terus-menerus bisa merupakan gejala penyakit. Berikut cara mengatasi tubuh cepat lelah.'),
(378, 191, 'en', '', '', ''),
(379, 192, 'id', 'Tips Memilih Moisturizer yang Bagus Sesuai Jenis Kulit', 'Moisturizer, pelembab, pelembab wajah, moisturizer untuk kulit berminyak, moisturizer untuk kulit kering, moisturizer adalah, moisturizer untuk kulit kombinasi, moisturizer terbaik, moisturizer yang bagus, moisturizer untuk kulit sensitif', 'Menjaga kelembapan kulit merupakan hal penting yang harus dilakukan. Ini tips memilih moisturizer yang bagus sesuai jenis kulit agar kulit tetap lembab.'),
(380, 192, 'en', 'Tips Memilih Moisturizer yang Bagus Sesuai Jenis Kulit', '', ''),
(381, 193, 'id', 'Awas, Ini Gangguan Kesehatan Akibat Stres', 'stres, kesehatan tubuh, akibat stres, dampak stres, akibat stres berlebihan', 'Stres yang berkelanjutan dan tidak berhenti dapat mempengaruhi kesehatan tubuh. Ada beberapa faktor yang bisa menyebabkan gangguan kesehatan akibat stres.'),
(382, 193, 'en', '', '', ''),
(383, 194, 'id', 'Mau Tahu Cara Mengecilkan Pipi Tembem? Lihat Ini', 'pipi chubby, pipi tembem, cara mengecilkan pipi tembem, cara mengecilkan pipi tembem secara alami, cara mengatasi pipi tembem agar tirus', 'Bagi pemilik pipi chubby yang ingin mengecilkan dan terlihat tirus, berikut ini diuraikan dengan singkat mengenai cara mengecilkan pipi tembem secara alami.'),
(384, 194, 'en', 'Mau Tahu Cara Mengecilkan Pipi Tembem? Lihat Ini', '', ''),
(385, 195, 'id', 'Dampak Negatif Hp, Gangguan Mata hingga Kanker Otak?', 'dampak negatif hp, dampak negatif handphone, dampak hp, dampak radiasi hp, smartphone, ponsel', 'Menggunakan hp terlalu lama berakibat buruk bagi kesehatan. Dampak negatif hp bisa mengakibatkan gangguan mata hingga kanker otak, benarkah? Ini penjelasannya.'),
(386, 195, 'en', '', '', ''),
(387, 196, 'id', 'Berikut Cara Memilih Sunscreen Terbaik Sesuai Jenis Kulit', 'sunscreen, sunscreen untuk kulit berminyak, sunscreen terbaik, sunscreen untuk kulit berjerawat, sunscreen untuk kulit sensitif, sunscreen untuk kulit kombinasi', 'Menjaga agar kulit tidak rusak dari paparan sinar UV adalah dengan memakai sunscreen terbaik sesuai dengan jenis kulit. Sehingga kulit tetap sehat dan cantik.'),
(388, 196, 'en', '', '', ''),
(389, 197, 'id', 'Nggak Perlu Cemas Punya Kulit Gelap, Ini Keistimewaannya', 'kulit gelap, warna kulit gelap, kulit kusam dan gelap, penyebab kulit gelap', 'Untuk terlihat cantik tidak harus memiliki kulit putih dan cerah. Karena kulit gelap juga bisa tampak cantik dan menarik. Ini keistimewaan warna kulit gelap.'),
(390, 197, 'en', '', '', ''),
(391, 198, 'id', 'Malas Olahraga? Coba Cara Ini untuk Melawannya', 'olahraga, olahraga adalah, olahraga di rumah, olahraga ringan di rumah, olahraga mengecilkan perut, olahraga menurunkan berat badan, olahraga mengecilkan paha, olahraga meninggikan badan', 'Untuk menjaga tubuh tetap sehat dan bugar adalah dengan melakukan olahraga secara teratur. Berolahraga juga bisa meningkatkan imunitas tubuh dan mencegah penyakit.'),
(392, 198, 'en', '', '', ''),
(393, 199, 'id', 'Duh Kulit Keriput, Ini Cara Memilih Krim Anti Aging Terbaik', 'anti aging, anti aging terbaik, anti aging cream, krim anti aging, anti aging moisturizer, krim anti aging kulit berminyak', 'Faktor penyebab kulit keriput adalah karena usia kian bertambah. Untuk mengatasinya kamu perlu mengetahui cara memilih krim anti aging terbaik.'),
(394, 199, 'en', '', '', ''),
