(849, 447, 'id', 'xyz', 'xxxxxxx', 'Menjaga penampilan agar terlihat tetap cantik itu nggak susah kok. Kamu bisa selalu tampak memesona dengan memakai makeup natural di rumah. Tapi jangan sampai salah ya cara pakai makeup-nya, karena kalau tidak tepat malah bukan cantik yang diperoleh. Nah, di bawah ini dijelaskan mengenai tips make up natural untuk pemula.\n\nMake Up Natural untuk Pemula\n\n1. Eye Shadows\n\nPenting nih bagi kamu, tips make up natural untuk pemula adalah menggunakan eye shadows. Gunakan eye shadows berwarna cokelat yang satu atau dua tone lebih tua dibanding warna kulitmu. Jangan pilih warna terlalu gelap, karena akan terlihat tidak natural.\n\n2. Blush On\n\nAgar wajah tampak segar, kamu bisa memakai blush on. Pilih blush on berwarna natural, seperti pink dan coral untuk kulit wajah terang atau oranye untuk kulit wajah sawo matang. Terapkan blush on di bagian tulang pipi dan ratakan dengan brush. Kalau terlalu tebal, kamu bisa menyamarkan dengan bedak.\n\nLihat juga: Alasan Perawatan ke Klinik Kecantikan (Bagian 1)\n\n3. Light Foundation\n\nTips make up natural untuk pemula selanjutnya adalah jangan menggunakan foundation dengan warna yang terlalu terangdari kulitmu. Pilih foundation yang bagus yang mendekati warna asli kulit agar terlihat alami.\n\nSelain itu, kamu juga bisa menggunakan foundation berbentuk powder yang lebih ringan dibanding foundation berbentuk krim. Ketika menggunakan foundation, pakai brush atau spons agar lebih rata.\n\n4. Moisturiser\n\nPemakaian moisturiser atau pelembab wajah jangan sampai lupa ya, karena akan membantu membuat kulit lebih lembab, sehingga kulit terjaga dan makeup menempel dengan baik. Bagi kamu yang punya kulit berminyak juga penting menggunakan pelembab sebelum memakai makeup. Pilih pelembab berbahan dasar air atau memberikan efek mattifying.\n\nLihat juga: Eye Cream yang Bagus untuk Remaja\n\n5. Powder\n\nYang tak kalah penting dalam tips make up natural untuk pemula adalah memakai bedak di bagian wajah yang sering berminyak, seperti hidung, dahi, dan dagu. Sedangkan untuk area kering tak perlu ditambahkan bedak. Pilih bedak berwarna sama dengan warna kulit agar terlihat alami.\n\n6. Lipstik\n\nLipstik juga berperan dalam makeup natural untuk pemula. Nah, agar terkesan alami dan ringan, pakai lipstik dengan warna nude, seperti pink, peach, atau nude. Kalau kamu lebih memilih tidak menggunakan lipstik, bisa memakai lip gloss.\n\n7. Concealer\n\nTips make up natural untuk pemula berikutnya yaitu memakai concealer yang berguna menutupi noda hitam atau warna tidak rata di wajah. Pilih concealer dengan warna yang sama dengan warna kulit untuk membantu menutup noda hitam. Aplikasikan concealer dengan brush agar hasil make up natural.'),
